import React from 'react';
import ReactDOM  from 'react-dom';
const Quiz=(props)=>
{
    let x=props.x;
    let y=props.y;
    let z=props.z;
    
   return(
       <div style={{width:'250px',justifyContent:'center',border:'1px solid black'}}>
            {((x===y)&&(y==z))?<><h5>{x} {y} {z} <br/>Matched</h5> <hr /></>:<><h5>{x} {y} {z} <br/>Not Matched</h5> <hr /></>}
        </div>   
   );
  
}
export default Quiz;
